import React from "react"
import { Flex, Text, Box, Image, Row, Column } from "rebass"
const Title = props => (
	<Row>
		{props.titles.map(title, key => (
			<Column key={`${title}-${key}`}>{title}</Column>
		))}
	</Row>
)
export const TableLine = props => (
	<Row>
		{props.children}
		<Column>
			<Image src="/5/edit.png" />
		</Column>
		<Column>
			<Image src="/5/1.png" />
		</Column>
		<Column>
			<Image src="/5/2.png" />
		</Column>
		<Column>
			<Image src="/7/bigger.png" />
		</Column>
	</Row>
)
export default props => {
	return (
		<Flex
			sx={{
				cursor: "pointer",
				background: "#FFF0E5"
			}}
		>
			<Title titles={props.titles} />
			<Box style={{ margin: "0 18px 18px 18px" }}>{props.children}</Box>
		</Flex>
	)
}
